import React from "react";
import CssBaseline from "@material-ui/core/CssBaseline";
import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/styles";

const styles = theme => ({
  root: {
    display: "flex",
    minHeight: "100vh",
    alignItems: "center",
    paddingTop: "64px",
    backgroundColor: "#F03D5C"
  },
  title: {
    fontSize: "56px",
    fontFamily: "lato",
    fontWeight: "bold"
  },
  text: {
    fontSize: "26px",
    fontFamily: "lato"
  },
  img: {
    width: "100%"
  },
  description: {}
});

class Home extends React.Component {
  render() {
    const { classes } = this.props;

    return (
      <Grid
        container
        component="main"
        id="home"
        justify="space-evenly"
        className={classes.root}
        xs={12}
      >
        <CssBaseline />

        <Grid item>
          <img
            className={classes.img}
            src={window.location.origin + "/workteam.svg"}
          />
        </Grid>

        <Grid item className={classes.description}>
          <Typography className={classes.text} align="center">
            A coffee apps é uma empresa que surgiu no alojamento do ITA. Um
            instituto de excelência nacional e internacional.
            GrandesPersonalidades como Bill Gates, Elon Musk e Jeff Bezos
            afirmaram <b>publicamente</b> que só contratavam alunos do ITA.{" "}
            <br />
            Aproveitando para relacionar com os fatos históricos, Buda foi um
            dos primeiros alunos da instituição, após se formar na T(-33) ele
            ascendeu e várias pessoas começaram a segui-lo. Dizem os boatos que
            seu nome de bixo é Borat. Para finalizar, podemos.
          </Typography>
        </Grid>
      </Grid>
    );
  }
}

Home.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(Home);
